"use client";
import React, { useRef } from "react";
import { useRouter } from "next/navigation";
import Input from "@/app/components/Input/Input";
import Button from "@/app/components/Button/Button";
import Modal from "@/app/components/Modal/Modal";
import Text from "@/app/components/Text/Text";
import Link from "next/link";

const Login = () => {
  const router = useRouter();
  const showSuccessModalRef = useRef<HTMLDialogElement | any>();

  const handleSubmitButtonClick = () => {
    if (showSuccessModalRef && showSuccessModalRef.current) {
      showSuccessModalRef.current.showModal();
    }

    setTimeout(() => {
      router.push("/user/dashboard");
    }, 2000);
  };

  return (
    <section className="w-screen h-screen flex-col flex mx-auto items-center justify-center">
      <Modal ref={showSuccessModalRef}>
        <section>
          <div className="success-icon flex items-center justify-center">
            <svg
              width="130"
              height="130"
              viewBox="0 0 209 208"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
              xmlnsXlink="http://www.w3.org/1999/xlink"
            >
              <rect x="0.5" width="208" height="208" fill="url(#pattern0)" />
              <defs>
                <pattern
                  id="pattern0"
                  patternContentUnits="objectBoundingBox"
                  width="1"
                  height="1"
                >
                  <use
                    xlinkHref="#image0_147_268"
                    transform="scale(0.00200401)"
                  />
                </pattern>
                <image
                  id="image0_147_268"
                  width="499"
                  height="499"
                  xlinkHref="data:image/png;base64,"
                />
              </defs>
            </svg>
          </div>
          <h3 className="text-2xl font-bold text-secondary capitalize my-5 text-center">
            Login successful
          </h3>
          <Text className="my-3">Redirecting you to dashboard</Text>

          <Button>Proceeed to dashboard</Button>
        </section>
      </Modal>
      <form className="w-full p-2 md:w-1/2 xl:w-1/4">
        <section className="header-section my-8">
          <h3 className="text-2xl capitalize font-bold">Login</h3>
        </section>
        <section className="my-4 mb-5">
          <label htmlFor="password" className="text-md block my-2">
            DID
          </label>
          <Input type="password" name="password" placeholder="Enter your DID" />
        </section>

        <section className="my-4 mb-5 w-full">
          <Button className="button-shadow-2" onClick={handleSubmitButtonClick}>
            Login
          </Button>
        </section>

        <section>
          <Text className="inline">
            no account?
            <Link
              className="capitalize text-secondary px-1"
              href={"/auth/signup"}
            >
              create account
            </Link>
          </Text>
        </section>
      </form>
    </section>
  );
};

export default Login;
